import React from 'react';
import './App.css';
import Home from './components/home';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Sidebar from './components/Sidebar';
import MultiChartPage from './components/MultiChartPage';
import BarChartPage from './components/BarChartPage';
import Chart3Page from './components/Chart3Page';
import ChartCandlesticks from './components/ChartCandle';

function App() {
  return (
    <div style={{display:"flex", flexDirection:"row"}}>
      <Sidebar />
      <div style={{width:"30px"}}></div>
      <Router>
        <Route exact path="/"><Home/></Route>
        <Route exact path="/multilineChart"><MultiChartPage /></Route>
        <Route exact path="/barChart"><BarChartPage/></Route>
        <Route exact path="/chart3"><Chart3Page/></Route>
        <Route exact path="/chartCandle"><ChartCandlesticks/></Route>
      </Router>

    </div>
  );
}

export default App;
